import React from 'react';
import web from '../src/images/home.jpeg'
import Common from './Common';
const Home= () =>{

    return (

        <>
         <Common 
            name="Grow your business with " 
            imgsrc={web}
             vist="/service"
            btnname="Get started"/>
      
        </>
    );
}

export default Home;
